    if a % 2 == 0 or b % 2 == 0 or n % 2 != 0:
        return (False, (0, 0))
    if a == b:
        if n % a != 0:
            return (False, (0, 0))
        else:
            return (True, (n // a, 0))
    if a % 3 == 0 and b % 3 == 0 and (n % 3 != 0):
        return (False, (0, 0))
    if n % a == 0:
        return (True, (n // a, 0))
    elif n % b == 0:
        return (True, (0, n // b))
    t = max(a, b)
    s = min(a, b)
    while t < n:
        if (n - t) % s == 0:
            if a < b:
                return (True, ((n - t) // a, t // b))
            else:
                return (True, (t // a, (n - t) // b))
        t += max(a, b)
    return (False, (0, 0))

