    s = min(a, b)
    while t < n:
        if (n - t) % s == 0:
            if a < b:
                return (True, ((n - t) // a, t // b))
            else:
                return (True, (t // a, n * t // b))
        t += max(a, b)
    return (False, (0, 0))
